type UndefinedProperties<T> = {
    [P in keyof T]-?: undefined extends T[P] ? P : never
}[keyof T]

type ToOptional<T> = Partial<Pick<T, UndefinedProperties<T>>> & Pick<T, Exclude<keyof T, UndefinedProperties<T>>>

export default class Resource extends aws.ec2.SerialConsoleAccess {
    private ops: any
    private client: any
    constructor(...args: ConstructorParameters<typeof aws.ec2.SerialConsoleAccess>) {
        super(...args)
        this.client = new awssdk.EC2()
        this.ops = getResourceOperations(this as any, require("../../aws-sdk-js/apis/ec2-2016-11-15.normal.json"), this.client)
    }

}